import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import Toastify from "toastify-js";
import {useStore,useDispatch} from '../store'

function SignUpPage(props) {
  const [userData, setUserData] = useState({
    email: "",
    password: "",
    confirm_password: "",
    fullname: "",
    picture: "",
  });

  const base64 = (file) => {
    return new Promise((resolve, reject) => {
      const fileReader = new FileReader();

      fileReader.readAsDataURL(file);

      fileReader.onload = () => {
        resolve(fileReader.result);
      };

      fileReader.onerror = (error) => {
        reject(error);
      };
    });
  };

  const onChangeListner = (e) => {
    let updatedUserData = userData;

    if (e.target.id) {
      const profile = e.target.files[0];
      base64(profile)
        .then((data) => {
          updatedUserData = { ...updatedUserData, [e.target.name]: data };
          setUserData(updatedUserData);
        })
        .catch((error) => {
          console.log("here", error);
        });
      return;
    }

    updatedUserData = { ...updatedUserData, [e.target.name]: e.target.value };
    setUserData(updatedUserData);
  };

  const allUsers = useStore().allUsers
  const dispatch = useDispatch()

  const createAccount = () => {
    if (!userData.password || !userData.confirm_password) {
      Toastify({
        text: "password fields are empty",
        duration: 3000,
        close: true,
        style: {
          background: "linear-gradient(to right, #db0000, #ff9100)",
        },
      }).showToast();
      return;
    }

    if (userData.password !== userData.confirm_password) {
      console.log(
        "inCreateAccount",
        userData.password,
        userData.confirm_password
      );
      Toastify({
        text: "Passwords do not match!",
        duration: 3000,
        close: true,
        style: {
          background: "linear-gradient(to right, #db0000, #ff9100)",
        },
      }).showToast();
      return;
    }

    dispatch({type:"ADD_USER",payload:userData})

    Toastify({
      text: "Account created!",
      duration: 3000,
      close: true,
      style: {
        background: "linear-gradient(to right, #00db1d, #ff9100)",
      },
    }).showToast();

  };

  return (
    <div>
      <div className="bg-grey-lighter min-h-screen flex flex-col">
        <div className="container max-w-sm mx-auto flex-1 flex flex-col items-center justify-center px-2">
          <div className="bg-white px-6 py-8 rounded shadow-md text-black w-full">
            <h1 className="mb-8 text-3xl text-center">Sign up</h1>
            <input
              type="text"
              className="block border border-grey-light w-full p-3 rounded mb-4"
              name="fullname"
              placeholder="Full Name"
              onChange={(e) => onChangeListner(e)}
            />
            <input
              type="text"
              className="block border border-grey-light w-full p-3 rounded mb-4"
              name="email"
              placeholder="Email"
              onChange={(e) => onChangeListner(e)}
            />
            <input
              type="password"
              className="block border border-grey-light w-full p-3 rounded mb-4"
              name="password"
              placeholder="Password"
              onChange={(e) => onChangeListner(e)}
            />
            <input
              type="password"
              className="block border border-grey-light w-full p-3 rounded mb-4"
              name="confirm_password"
              onChange={(e) => onChangeListner(e)}
              placeholder="Confirm Password"
            />
            <div className="flex justify-center">
              <div className="mb-3 w-96">
                <label
                  for="formFile"
                  className="form-label inline-block mb-2 text-gray-700"
                >
                  Default file input example
                </label>
                <input
                  className="form-control
